// 3. MAIN LOOP
// --------------------------------------------------------------------------
int main() {
    int i, ch, img_idx;
    int correct_count = 0;
    
    // Buffers
    int8_t l1_out[3 * 144];
    int8_t conv1_temp[576];
    int8_t l2_out[3 * 16];
    int8_t conv2_temp[64];
    int8_t fc_out[10];

    printf("=== Testing %d Images ===\n", NUM_TEST);

    for(img_idx = 0; img_idx < NUM_TEST; img_idx++) {
        
        // Layer 1
        for(ch = 0; ch < 3; ch++) {
            conv2d_fixed(test_images[img_idx], 28, &w_l1[ch * 25], MULT_L1, conv1_temp, 24);
            pooling2d_fixed(conv1_temp, &l1_out[ch * 144], 1, 24, 24, 2);
        }

        // Layer 2
        for(ch = 0; ch < 3; ch++) {
            conv2d_3ch_fixed(l1_out, &w_l2[ch * 75], MULT_L2, conv2_temp, 12);
            pooling2d_fixed(conv2_temp, &l2_out[ch * 16], 1, 8, 8, 2);
        }

        // FC
        mat_mult_fixed(l2_out, w_l3, fc_out, 48, 10, MULT_FC);

        // Check
        int max_val = -128, max_idx = 0;
        for(i=0; i<10; i++) {
            if(fc_out[i] > max_val) { max_val = fc_out[i]; max_idx = i; }
        }
        
        // Print less to save console space
        // printf("Img %d: Pred %d, True %d\n", img_idx, max_idx, test_labels[img_idx]);
        
        if(max_idx == test_labels[img_idx]) correct_count++;
    }

    printf("\n=============================\n");
    printf("Final Result:\n");
    printf("Correct: %d / %d\n", correct_count, NUM_TEST);
    printf("Accuracy: %.2f%%\n", (float)correct_count / NUM_TEST * 100);
    printf("=============================\n");

    return 0;
}
